import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Make extends Component {


  render() {
    const { make, select } = this.props
    return (
      <Link to={`/${make}/selectModel`} >
        <div className="button-div">
          <button name="make" value={make} onClick={(e) => select(make)}>{make}</button>
        </div>
      </Link>
    );
  }

}

export default Make;
